import React from 'react';
import logo from './logo.svg';
import './App.css';
import {Carousel} from 'antd';
import {Row, Col} from 'antd';


function App() {
  return (
    <div className="App">

      <div className="Inner">

        <div className="Title">
          <div>
            <h1 className="logo">
              <mark>AFTERHOURS</mark>
            </h1>
          </div>
          <div>
            <h3 className="Title-text">
              ROCHESTER'S PREMIER CO-ED A CAPPELLA GROUP
              <br/>
              EST. 1950

            </h3>
          </div>
        </div>

        <div className="Slideshow">

        </div>

        <div className="About-us">

        </div>

        <div className="Connect">

        </div>
      </div>

    </div>
  );
}

export default App;
